function StaffDashboard() {
  return (
    <div>
      <h1>Staff Dashboard</h1>

      <ul>
        <li>View Assigned Appointments</li>
        <li>Update Service Status</li>
        <li>Manage Availability</li>
      </ul>
    </div>
  );
}

export default StaffDashboard;
